import React from 'react';
import styled from 'styled-components';
import SmoothCorners from '../components/common/SmoothCorner';

const CirclesContainer = styled.div``;

const Circle = styled.span`
  width: 5px;
  height: 5px;
`;

const NavButton = () => {
  return (
    <SmoothCorners>
      <CirclesContainer>
        <Circle />
      </CirclesContainer>
    </SmoothCorners>
  );
};

export default NavButton;
